import React from "react";

function ClinicFeedback() {
  return (
    <div>
      <textarea placeholder="Clinick feedback" />
      <br />
      <br />
      <input type="number" placeholder="Clinic rate(1-10)" />
    </div>
  );
}

export default ClinicFeedback;
